import React from "react";
import { RenderAfterNavermapsLoaded, NaverMap, Marker } from "react-naver-maps"; // 패키지 불러오기
import "./App.css";

function NaverMapAPI() {
  const navermaps = window.naver.maps;

  return (
    <NaverMap
      mapDivId={"maps-getting-started-uncontrolled"} // default: react-naver-map
      style={{
        width: "100%", // 네이버지도 가로 길이
        height: "100vh", // 네이버지도 세로 길이
      }}
      defaultCenter={{ lat: 35.87, lng: 128.6 }} // 지도 초기 위치
      defaultZoom={12} // 지도 초기 확대 배율
    >
      <Marker
        key={1}
        position={new navermaps.LatLng(35.87, 128.6)}
        animation={2}
        onClick={() => {
          document.location.href = "http://www.naver.com/";
        }}
      />
    </NaverMap>
  );
}

function App() {
  return (
    <RenderAfterNavermapsLoaded
      ncpClientId={"pg43l9dp5c"} // 자신의 네이버 계정에서 발급받은 Client ID
      error={<p>Maps Load Error</p>}
      loading={<p>Maps Loading...</p>}
    >
      <NaverMapAPI />
    </RenderAfterNavermapsLoaded>
  );
}

export default App;
